import React, { Fragment } from 'react';
import '../App.css';

// components
import Home_Body from '../Components/home_body';
import Navigation from '../Components/navigation';
import FooterBar from '../Components/footer';

function Home() {
    return (
        <Fragment>
            <Navigation />
            <div class="row">
                <div className="container fluid">
                    <Home_Body />
                </div>
            </div>
            <FooterBar />
        </Fragment>
    );
};

export default Home;
